import React, {useEffect, useState} from "react";


const TABLE_HEAD = ["S/No", "Name", "Capacity", "Location", "", ""];

const TABLE_ROWS = [
  {
    name: "1",
    amount: "Venue A",
    date: "25",
    status: "location A",
    expiry: "",
  },
  {
    name: "Allen .Z. Mwalwama",
    amount: "$5,000",
    date: "Wed 1:00pm",
    status: "paid",
    expiry: "06/2026",
  },
  {
    name: "Ugaly .z. Lwama",
    amount: "$3,400",
    date: "Mon 7:40pm",
    status: "pending",
    expiry: "06/2026",
  },
  {
    name: "Allenn .Z. Mwalwama",
    amount: "$1,000",
    date: "Wed 5:00pm",
    status: "paid",
    expiry: "06/2026",
  },
  {
    name: "Alleni .Z. Mwalwama",
    amount: "$14,000",
    date: "Wed 3:30am",
    status: "cancelled",
    expiry: "06/2026",
  },
    {
    name: "Jaseph .A. Mwalwamaa",
    amount: "$2,500",
    date: "Wed 3:00pm",
    status: "paid",
    expiry: "06/2026",
  },
  {
    name: "Allen .Z. Mwalwamaa",
    amount: "$5,000",
    date: "Wed 1:00pm",
    status: "paid",
    account: "Airtel-Money",
    expiry: "06/2026",
  },
  {
    name: "Ugaly .z. Lwamaa",
    amount: "$3,400",
    date: "Mon 7:40pm",
    status: "pending",
    account: "T-pesa",
    expiry: "06/2026",
  },
  {
    name: "Alleni .Z. Mwalwamaa",
    amount: "$1,000",
    date: "Wed 5:00pm",
    status: "paid",
    account: "M-Pesa",
    expiry: "06/2026",
  },
  {
    name: "Alleny .Z. Mwalwamaa",
    amount: "$14,000",
    date: "Wed 3:30am",
    status: "cancelled",
    account: "M-Pesa",
    expiry: "06/2026",
  },
];

const Venue = () => {

   const [isDarkTheme, setIsDarkTheme] = useState(
    localStorage.getItem("color-theme") === "dark"
  );

  useEffect(() => {
    setIsDarkTheme(localStorage.getItem("color-theme") === "dark");
  }, []);

    return (
        <div>
            <div className="h-full w-full">
      <div className="mb-4 flex flex-col justify-between gap-8 md:flex-row md:items-center">
        <div></div>
        <div className="flex w-full shrink-0 gap-2 md:w-max">
          <div className="w-full mt-1 md:w-72">
            <input
              type="text"
              className="bg-dark text-dark rounded-md p-2 border border-black"
              placeholder="Tafuta mteja hapa"
            />
          </div>
          <button className="flex items-center gap-3" size="sm">
            <svg
              xmlns="http://www.w3.org/2000/svg"
              fill="none"
              viewBox="0 0 24 24"
              stroke="currentColor"
              className="h-4 w-4"
            >
              <path
                strokeLinecap="round"
                strokeLinejoin="round"
                strokeWidth="2"
                d="M19 9l-7 7-7-7"
              />
            </svg>
            Download
          </button>
        </div>
      </div>

      <div className="overflow-auto px-0">
        <table className="w-full min-w-max table-auto text-left overflow-auto">
          <thead>
            <tr>
              {TABLE_HEAD.map((head, index) => (
                <th
                  key={index}
                  className="border-y border-blue-gray-100 bg-blue-gray-50/50 p-4"
                >
                  <p
                    className={`leading-none opacity-70 ${
                      isDarkTheme ? "font-bold" : ""
                    }`}
                  >
                    {head}
                  </p>
                </th>
              ))}
            </tr>
          </thead>
          <tbody>
            {TABLE_ROWS.map((row, index) => {
              const isLast = index === TABLE_ROWS.length - 1;
              const classes = isLast
                ? "p-4"
                : "p-4 border-b border-blue-gray-50";

              return (
                <tr key={row.name}>
                  <td className={`${classes} ${isDarkTheme ? "text-dark" : ""}`}>
                    <div className="flex items-center gap-3">
                      <p
                        className={`font-bold ${
                          isDarkTheme ? "text-dark" : ""
                        }`}
                      >
                        {row.name}
                      </p>
                    </div>
                  </td>
                  <td className={`${classes} ${isDarkTheme ? "text-dark" : ""}`}>
                    <p
                      className={`font-normal ${
                        isDarkTheme ? "text-dark" : ""
                      }`}
                    >
                      {row.amount}
                    </p>
                  </td>
                  <td className={`${classes} ${isDarkTheme ? "text-dark" : ""}`}>
                    <p
                      className={`font-normal ${
                        isDarkTheme ? "text-dark" : ""
                      }`}
                    >
                      {row.date}
                    </p>
                  </td>
                  <td className={`${classes} ${isDarkTheme ? "text-dark" : ""}`}>
                    <div className="w-max">
                      <span
                        className={`bg-${
                          row.status === "paid"
                            ? "green"
                            : row.status === "pending"
                            ? "amber"
                            : "red"
                        }`}
                      >
                        {row.status}
                      </span>
                    </div>
                  </td>
                  <td className={`${classes} ${isDarkTheme ? "text-dark" : ""}`}>
                    <div className="flex items-center gap-3">
                      <div className="flex flex-col">
                        <p
                          className={`font-normal capitalize ${
                            isDarkTheme ? "text-dark" : ""
                          }`}
                        >
                          {row.account.split("-").join(" ")}
                        </p>
                        <p
                          className={`font-normal opacity-70 ${
                            isDarkTheme ? "text-dark" : ""
                          }`}
                        >
                          {row.expiry}
                        </p>
                      </div>
                    </div>
                  </td>
                </tr>
              );
            })}
          </tbody>
        </table>
      </div>
      <div className="flex items-center justify-between border-t border-blue-gray-50 p-4">
        <button className="border rounded-md p-2" size="sm">
          Previous
        </button>
        <div className="flex items-center gap-2">
          <button className="border rounded-md p-2" size="sm">
            1
          </button>
          <button className="border rounded-md p-2" size="sm">
            ...
          </button>
          <button className="border rounded-md p-2" size="sm">
            10
          </button>
        </div>
        <button className="border rounded-md p-2" size="sm">
          Next
        </button>
      </div>
    </div>
        </div>
    )
}
export default Venue
